import React from 'react';
import api from '../services/OpenAI';

class PetNamesComponent extends React.Component{
    constructor(props){
        this.specieInput = props.specieInput;
        this.api = api;
    }
    state = {
        petNames: [],
        specie: '',
    }

    componentDidMount(){
        this.api.post("nlp-pet-name/specie/"+this.props.specieInput).then(
            res =>{
                console.log(res.data);
                const specie = res.data.specie;
                this.setState({ specie });

                const petNames = res.data.names;
                this.setState({ petNames });
            })
    }

    render(){
        return(
            <div className="result-pet-names">
            <ul>
            {console.log(this.state.petNames)}
            {console.log(this.state.specie)}
            {/* {this.state.petNames.map(petName => <li>{petName.names}</li>)} */}
            </ul>
        </div>
        )
    }
}

export default PetNamesComponent;
